function usage {
	echo "Usage: $(basename $0) BCID0 BCID1 ... BCID7".
	echo "Less than 8 BCID are allowed, but not more. At least one BCID is required"
}

template_file=/tmp/bookcrossing_sticker_fr.png
output_file=tagged_bc.png

if [ $# -gt 8 -o $# -eq 0 ]; then
	usage
	exit
fi

decode_image $template_file

x_coord=(400 1650)
y_coord=(803 1653 2510 3365)

i=0
for x in 0 1; do
	for y in 0 1 2 3; do
		cmd[$i]="-draw 'text ${x_coord[$x]},${y_coord[$y]}"
		i=$((i+1))
	done
done

j=0
for bcid in "$@"
do
    cmd[$j]=${cmd[$j]}" \"$bcid\"'"
	j=$((j+1))
done

final_cmd="convert -font helvetica -fill black -pointsize 75"
for i in $(seq 0 "$((j-1))"); do
	final_cmd="${final_cmd} ${cmd[$i]}"
done
final_cmd="${final_cmd} $template_file $output_file"

eval "$final_cmd"
